INSERT INTO `block_custom` VALUES (3,'<div class=\"span7 logo\">\r\n            <h1><a href=\"/\">Minnehaha<i>Lofts</i></a> </h1>\r\n            <p>Welcome Home!</p>\r\n</div>','Minnehaha Logo','full_html'),(4,'<ul class=\"nav nav-list\">\r\n                    <li class=\"nav-header\">Locations</li>\r\n                    <li class=\"#\"><a href=\"${createLink(action: \'sydney\')}\"><i class=\"icon-home\"></i> Charming Home - Sydney</a></li>\r\n                    <li><a href=\"${createLink(action: \'minnehaha\')}\"><i class=\"icon-home\"></i> Cute Home - Minnehaha</a></li>\r\n                    <li><a href=\"${createLink(action: \'riga\')}\"><i class=\"icon-home\"></i> Cozy Apt - Riga</a></li>\r\n                    <li class=\"divider\"></li>\r\n</ul>','List of properties organized into Location menu ','full_html'),(5,'<ul class=\"nav nav-list\">\r\n      <li class=\"nav-header\">Other</li>\r\n      <li><a href=\"#\"><i class=\"icon-map-marker\"></i> Map</a></li>\r\n      <li><a href=\"what-our-guests-say-about-corporate-rental\"><i class=\"icon-comment\"></i> Testimonials</a></li>\r\n</ul>','Other Menu that lists other than Basic and Property pages','full_html'),(6,'<h2><i class=\"icon-envelope jarak-kecil\"></i>My Testimonial</h2>\r\n<label>Title </label><input class=\"span6\" type=\"text\" class=\"input-small\" id=\"reviewTitle\" name=\"title\" placeholder=\"Testimonial Title\" value=\"\">\r\n<label>My Testimonial</label><textarea class=\"input-xlarge span6\" id=\"reviewContent\" name=\"content\" placeholder=\"Type your testimonial here.\" value=\"\"></textarea><label>Nickname</label><input class=\"span6\" type=\"text\" name=\"submittedBy\" id=\"submittedBy\" placeholder=\"Type name as you wish it appear on the testimonial\" value=\"\">\r\n<label>I\'d Recommend This Property For:</label><textarea class=\"input-xlarge span6\" id=\"recommendedFor\" name=\"recommendedFor\" placeholder=\"For example, adventure seekers, romantic gateway, Age 55+...\" value=\"\"></textarea>\r\n<div class=\"control-group\">\r\n<div class=\"mutedMin\">\r\n<input type=\"text\" class=\"span4 preventRobots\" name=\"preventRobots\" value=\"Please, delete this text to leave it blank\"><span class=\"help-inline mn-help-inline\">(this prevents robots submit form)</span>\r\n</div>\r\n</div>\r\n<br/><button id=\"testimonialSubmitBt\" type=\"button\" class=\"btn btn-primary\">Send Testimonial</button>','Leaving testimonial form','full_html'),(7,'<h2><i class=\"icon-envelope jarak-kecil\"></i>Inquire</h2>\r\n<p><textarea class=\"input-xlarge span6\" id=\"inqPropertyContent\" name=\"inqPropertyContent\" value=\"\">Type your inquiry here.</textarea></p>\r\n<div class=\"control-group\">\r\n<div class=\"mutedMin\">\r\n<input class=\"span4 preventRobots\" type=\"text\" name=\"preventRobots\" value=\"Please, delete this text to leave it blank\"><span class=\"help-inline mn-help-inline\">(this prevents robots submit form)</span>\r\n</div>\r\n</div>\r\n<div class=\"input-prepend\"><span class=\"add-on\">E-Mail</span><input class=\"span2\" id=\"propertyUserEmail\" name=\"userEmail\" size=\"16\" type=\"text\" value=\"\"><a class=\"btn btn-success\" id=\"submitPropertyInq\" href=\"#\"><i class=\"icon-ok icon-white\"></i>Inquire</a></div>','Unit Inquiry Form','full_html');
